import './DisplayActivity.css';
import PropTypes from 'prop-types';
import { FaAvianex } from 'react-icons/fa';

/**
 * {"cost":250,
 * "duration":2,
 * "googleMapsImageLink":["https://upload.wikimedia.org/wikipedia/commons/1/19/TelAM.jpg"],
 * "googleMapsLink":["https://www.google.co.il/maps/place/%D7%9E%D7%95%D7%96%D7%99%D7%90%D7%95%D7%9F+%D7%AA%D7%9C+%D7%90%D7%91%D7%99%D7%91+%D7%9C%D7%90%D7%9E%D7%A0%D7%95%D7%AA%E2%80%AD/@32.0771846,34.7906177,17z/data=!3m1!4b1!4m5!3m4!1s0x151d4b9b02453fa7:0xf74ba430787ab813!8m2!3d32.0771761!4d34.7861374?hl=iw"],
 * "orderInAdvance":false,
 * "timeEnd":"Mon, 13 Jun 2022 19:32:40 GMT",
 * "timeStart":"Mon, 13 Jun 2022 19:32:40 GMT",
 * "title":"act1"}
 */
export default function DisplayActivity({ activity }) {
    function nothing() {

    }
    return(
    <div className="displayactivity-container">
        <div className='act-col'>
            <div className='act-row'>
                <div className='act-title'>{activity?.title}</div>
                <div className='act-pic' onClick={nothing} color='blue'><FaAvianex /></div>
            </div>
            <div className='act-row'>
                <div className='time line'>
                    {activity?.timeStart}{' => '}{activity?.timeEnd}
                </div>
                <div className='total time'>
                    total: {activity?.duration}hr
                </div>
                <div className='cost dash'>
                    cost: {activity?.cost}$
                </div>
            </div>
            <div className='act-row'>
                <div className='order'>
                    {activity?.orderInAdvance ? '*need to order reservation':''}
                </div>
            </div>
        </div>
    </div>
    )
}

DisplayActivity.propTypes = {
    activity: PropTypes.object.isRequired
}
